import React, { useContext, useState, useEffect } from 'react';
import './myOrders.css';
import { StoreContext } from '../../context/StoreContext'; // Ensure you're importing from the correct path
import axios from 'axios';

const MyOrders = () => {
  const { url,token } = useContext(StoreContext);
  const [data, setData] = useState([]);


  const fetchOrders = async () => {
    try {
      const response = await axios.post(url + "/api/order/userorders", {}, {
        headers: { token }
      });

      console.log("Response data:", response.data);  // Log the full response data

      if (response.data.success) {
        setData(response.data.data);
        console.log(response.data.data);  // Log the orders data
      } else {
        console.error("Failed to fetch orders:", response.data.message);
      }
    } catch (error) {
      // This error could be related to the axios request itself, not the server response
      console.error("Error fetching orders:", error.response ? error.response.data : error.message);
    }
  };


  useEffect(() => {
    if (token) {
      fetchOrders();
    }
  }, [token]);

  return (
    <div className="my-orders-container">

    </div>
  );
};

export default MyOrders;
